jQuery(function (t) {
  t(document.body).on(
    "click",
    'tr[data-plugin="muhiku-plug/muhiku-plug.php"] span.deactivate a',
    function (e) {
      if (
        t('tr.plugin-update-tr[data-plugin="muhiku-plug/muhiku-plug.php"]')
          .length ||
        t(this).hasClass("hasNotice")
      )
        return !0;
      e.preventDefault(), t(this).addClass("hasNotice");
      e = {
        action: "muhiku_forms_deactivation_notice",
        security: mhk_plugins_params.deactivation_nonce,
      };
      t.post(mhk_plugins_params.ajax_url, e, function (e) {
        t('tr[data-plugin="muhiku-plug/muhiku-plug.php"]')
          .addClass("updated")
          .last()
          .after(e.fragments.deactivation_notice);
      }).fail(function (e) {
        window.console.log(e.responseText);
      });
    }
  );
});
